window.bookSummaryJSON = "<p>The much-anticipated return of the hit Audible Original Mistletoe Murders series, featuring Cobie Smulders (<i>How I Met Your Mother</i>) reprising her role as the captivating Emily Lane in <i>Mistletoe Murders 3</i>.</p> <p>From Canadian Screen Award winner Ken Cuperus, with <i>Ginny &amp; Georgia</i>’s Raymond Ablack, plus a stellar ensemble cast featuring Anna Cathcart (<i>To All the Boys I’ve Loved Before</i>), Enrico Colantoni (<i>Veronica Mars</i>), Alex Mallari Jr (<i>Ginny and Georgia</i>) and Jean Yoon (<i>Kim’s Convenience</i>), this new season of the Audible Original will help you prepare for yet another cozy (and criminal) holiday season.</p> <p>When Emily Lane isn’t busy running her charming Christmas-themed store, ‘’Under the Mistletoe,‘’ located in the quaint tourist town of Fletcher’s Grove, she finds herself compelled to investigate not so quaint local murders. On the surface, Emily is a perfectly lovely, good-natured puzzle-solver and mystery lover. But she is hiding a secret past that has finally begun to catch up with her, as an old acquaintance arrives to throw a wedge between Emily and Sam’s burgeoning relationship, and worse, threatens to destroy the new life Emily has built for herself.</p> <p>The Mistletoe Murders Audible Original series inspired the Hallmark+ adaptation of the same name starring Sarah Drew and Peter Mooney.</p> <p>Available in Dolby Atmos on Audible.</p>"; 
